DROP TABLE IF EXISTS `sb_filter`;
CREATE TABLE `sb_filter` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(125) DEFAULT NULL,
  `display_name` varchar(125) DEFAULT NULL,
  `slug` varchar(125) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `shop_uuid` varchar(36) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uniq_name` (`name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8mb4;

DROP TABLE IF EXISTS `sb_filter_n_category`;
CREATE TABLE `sb_filter_n_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `filter_id` int(11) DEFAULT NULL,
  `category_id` int(11) DEFAULT NULL,
  `shop_uuid` varchar(36) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8mb4;

DROP TABLE IF EXISTS `sb_filter_value`;
CREATE TABLE `sb_filter_value` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `filter_id` int(11) DEFAULT NULL,
  `name` varchar(125) DEFAULT NULL,
  `slug` varchar(125) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `shop_uuid` varchar(86) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uniq` (`filter_id`,`name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=78 DEFAULT CHARSET=utf8mb4;


DROP TABLE IF EXISTS `sb_filter_value_n_product`;
CREATE TABLE `sb_filter_value_n_product` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `filter_value_id` int(11) DEFAULT NULL,
  `product_id` int(11) DEFAULT NULL,
  `shop_uuid` varchar(36) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

